import React from "react";

const Post = ({post}) => {
  return (
    <>
<div>
    <div>
        {post.surname}
    </div>
    <div>
        {post.firstNames}
    </div>
    <div>
        {post.contactNumber}
    </div>
    <div>
        {post.date}
    </div>
    <div>
        {post.age}
    </div>
    </div>    </>
  );
};

export default Post;
